import React from "react";
import { Route } from 'react-router-dom';

import Welcome from "./component/Welcome";
import Products from "./component/Product";

function App() {
  return (
    <div>
      <Route path="/welcome" >
        <Welcome />
      </Route>
    </div>
  );
}

export default App;
